import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import bg from "../home-bg.png"
import nurse from "../nurse.png";

function Home() {
    return (
        <div className="landing">
            <li>
                <ul>Our Team</ul>
                <ul>Portal</ul>
            </li>
            <div className="landing-content">
                <div>
                    <div>
                        <h1>Get convenience for</h1>
                        <h1>infusion monitoring.</h1>
                    </div>
                    <Link to="/"><Button>Try it now</Button></Link>
                </div>
                <img src={nurse} className="nurse"></img>
            </div>
        </div>
    );
}

export default Home;
